-- // Vellure.ESP~

--[[
VellureESP = loadstring(game:HttpGet("https://raw.githubusercontent.com/FlamesW/Vellure/main/Resources/EspLibrary.lua"))();

--[[
-- ==========================
-- Developer Settings
-- ==========================
VellureESP.DeveloperSettings.UnwrapOnCharacterAbsence = true; -- // Automatically unwrap objects if character is missing
VellureESP.DeveloperSettings.UpdateMode = "Heartbeat"; -- // ESP update mode
VellureESP.DeveloperSettings.TeamCheckOption = "TeamColor"; -- // Method for team checking
VellureESP.DeveloperSettings.WidthBoundary = 1.5; -- // Horizontal expansion for ESP boxes
VellureESP.DeveloperSettings.HeightBoundary = 1; -- // Vertical expansion for ESP boxes

-- ==========================
-- User Settings
-- ==========================
VellureESP.Settings.Enabled = true; -- // Players ESP
VellureESP.Settings.PartsOnly = false; -- // Only draw ESP on character parts
VellureESP.Settings.TeamCheck = false; -- // Show ESP for all players
VellureESP.Settings.AliveCheck = true; -- // Only show ESP for alive players
VellureESP.Settings.EnableTeamColors = false; -- // Enable coloring players by team
VellureESP.Settings.TeamColor = Color3.fromRGB(170, 170, 225); -- // Light blue team color

-- ==========================
-- ESP Properties
-- ==========================
VellureESP.Properties.ESP.Enabled = true; -- // Enable ESP boxes
VellureESP.Properties.ESP.Offset = 10; -- // ESP box offset from character
VellureESP.Properties.ESP.Color = Color3.fromRGB(255, 255, 255); -- // ESP box color (white)
VellureESP.Properties.ESP.Transparency = 1; -- // ESP box transparency
VellureESP.Properties.ESP.NameSize = 19.5; -- // Font size for player names
VellureESP.Properties.ESP.InfoSize = 17.5; -- // Font size for additional info
VellureESP.Properties.ESP.Font = DrawingFonts.Monospace; -- // Font type for ESP text
VellureESP.Properties.ESP.OutlineColor = Color3.fromRGB(0, 0, 0); -- // Outline color
VellureESP.Properties.ESP.Outline = true; -- // Outline enabled
VellureESP.Properties.ESP.DisplayDistance = true; -- // Display distance from local player
VellureESP.Properties.ESP.DisplayHealth = false; -- // Display health
VellureESP.Properties.ESP.DisplayName = false; -- // Display username
VellureESP.Properties.ESP.DisplayDisplayName = true; -- // Display display name
VellureESP.Properties.ESP.DisplayTool = true; -- // Display equipped tool

-- ==========================
-- Tracer Properties
-- ==========================
VellureESP.Properties.Tracer.Enabled = true; -- // Enable tracers
VellureESP.Properties.Tracer.Position = 1; -- // Tracer position
VellureESP.Properties.Tracer.Transparency = 1; -- // Tracer transparency
VellureESP.Properties.Tracer.Thickness = 1.35; -- // Tracer thickness
VellureESP.Properties.Tracer.Color = Color3.fromRGB(255, 255, 255); -- // Tracer color
VellureESP.Properties.Tracer.Outline = false; -- // Tracer outline enabled
VellureESP.Properties.Tracer.OutlineColor = Color3.fromRGB(0, 0, 0); -- // Tracer outline color

-- ==========================
-- Box Properties
-- ==========================
VellureESP.Properties.Box.Enabled = true; -- // Enable ESP boxes
VellureESP.Properties.Box.Color = Color3.fromRGB(255, 255, 255); -- // Box color
VellureESP.Properties.Box.Transparency = 1; -- // Box transparency
VellureESP.Properties.Box.Thickness = 2; -- // Box thickness
VellureESP.Properties.Box.Filled = false; -- // Fill box or outline only
VellureESP.Properties.Box.OutlineColor = Color3.fromRGB(0, 0, 0); -- // Box outline color
VellureESP.Properties.Box.Outline = false; -- // Box outline enabled

-- ==========================
-- Health Bar Properties
-- ==========================
VellureESP.Properties.HealthBar.Enabled = true; -- // Enable health bars
VellureESP.Properties.HealthBar.Offset = -5; -- // Health bar vertical offset
VellureESP.Properties.HealthBar.Blue = 100; -- // Blue channel modifier
VellureESP.Properties.HealthBar.Position = 25; -- // Health bar position relative to box
VellureESP.Properties.HealthBar.Thickness = 4; -- // Health bar thickness
VellureESP.Properties.HealthBar.Transparency = 1; -- // Health bar transparency
VellureESP.Properties.HealthBar.OutlineColor = Color3.fromRGB(255, 255, 255); -- // Health bar outline color
VellureESP.Properties.HealthBar.Outline = false; -- // Health bar outline enabled
--]]

--[[
-- ==========================
-- AddObjectListener Example
-- ==========================

VellureESP:AddObjectListener(workspace.Example.Items, {
    Type = "Item",
    Flag = "Item_ESP",
    Box = true,
    Tracer = true,
    ESP = true, -- // Dont touch
    RenderDistance = 5000,
    Recursive = false,
    CustomName = function(Object)
        return Object.Name
    end
})

VellureESP:AddObjectListener(workspace.Example.Enemies, {
    Type = "NPC", -- // Tracks NPCs
    Flag = "NPC_ESP", -- // Your Flag
    Box = true; -- // Enable ESP box around NPCs
    Tracer = true; -- // Draw tracers from player to NPC
    HealthBar = true; -- // Show health bar above NPC
    ESP = true; -- // Required for ESP visuals
    RenderDistance = 10000; -- // Max distance to render NPC ESP
    Recursive = true; -- // Include all descendants (children, nested parts)
    Validator = function(obj) -- // Only valid if NPC has Humanoid
        return obj:FindFirstChildOfClass("Humanoid") ~= nil
    end,
    CustomName = function(obj) -- // Display custom name for NPC
        local humanoid = obj:FindFirstChildOfClass("Humanoid")
        if humanoid and humanoid.DisplayName then
            return humanoid.DisplayName
        else
            return obj.Name
        end
    end,
    Color = Color3.fromRGB(255, 0, 0), -- // Red ESP for NPCs
    OutlineColor = Color3.fromRGB(0, 0, 0), -- // Outline color
    Distance = true; -- // Show distance to NPC
})

Environment.Init()

